//상단바 (Frame) 와 Footer 함수가 정의되어 있음

import './frame.css';
import { Maps } from '../../maps.js';
import {Logo, LogoAdd} from '../../logo.js';

import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link
} from 'react-router-dom';


function 아래화살표(){
  return (
    <img src="iconDown.png"
    width="10px"/>
  );
}


export function Frame(){
  const TabLink = ({ tabId, activeTab, onClick, children }) => {

    const handleClick = () => {
        onClick(tabId);
    };

    return (
        <a
            href={`#${tabId}`}
            onClick={handleClick}
            className={activeTab === tabId ? 'active' : ''}
        >
            {children}
        </a>
    );
};


  //tabLink
    return(
        <div>
        <Router>
        <div id="user">
          <Link to="/login" className ="topNav">로그인</Link>
          <Link to="/account" className ="topNav">회원가입</Link>
        </div>
        <div id="menu">
          <LogoAdd/>
          <nav id ="mainNav">
            <ul className = "horizontal-list">
              <li> <TabLink tabId="tab1" activeTab={activeTab} onClick={handleTabClick}>
                서비스 소개 <아래화살표/> 
                </TabLink>
              </li>
              <li><Link to="/게시판">게시판 <아래화살표/> </Link></li>
              <li><a href="/update.html">데이터 업로드 <아래화살표/> </a></li>
            </ul>
          </nav>
        </div>

        <Routes>
            <Route path="/login" elemtent={<Maps/>}/>
            <Route path="/account" element={<Maps/>}/>
            <Route path="/서비스소개" element={<네비네비게이션 data={0}/>}/>
            <Route path="/게시판" element={<네비네비게이션 data={1}/>}/>
          </Routes>
        </Router>

        </div>

    );
}

export function Banner({name}){

return (
    <div class="banner">
      <h1>{name}</h1>
      <img src="banner.jpg"/>
    </div>
);
}

export function ContentNav({name}){
  return (
    <nav className="contentNav">
        <ul>
            <li id="iconHome">
                <a href="./">
                    <img src="iconHome.png" width="20px"/>
                </a>
            </li>
            <li className="contentNav한칸">
                <a href="./">
                    <p>{name}</p>
                    <아래화살표/>
                </a>
            </li>
            <li className="contentNav한칸">
                <a href="./">
                    <p>인사말</p>
                    <아래화살표/>
                </a>
            </li>
        </ul>
    </nav>
    );
}


export function Footer(){
  return(
      <div className='footer'>
          <div className="footerBox">
              <Logo/>
              <div>
                  <div className="footerInfo">
                      <div>서울시 광진구 능동로 209 세종대학교</div>
                      <div>TEL : 010-@@@@-@@@@</div>
                      <div>Email : @sju.ac.kr</div>
                  </div>
                  <div>Copyright@ 2023 Sejong RDD | All Rights Reserved</div>
              </div>
          </div>
      </div>
  );
}
